import AwesomeSlider from 'react-awesome-slider';
import withCaption from 'react-awesome-slider/dist/captioned';
import 'react-awesome-slider/dist/styles.css';
import 'react-awesome-slider/dist/captioned.css';

const CaptionedSlider = withCaption(AwesomeSlider);

const Home = () => {
    return (
        <Fragment>
            <div className="direct-center text-dark">
                <h1>Paul Ly</h1>     
            </div>
            <div className="text-center">
                I am a full stack developer in training. Always willing to learn
                more.
            </div>    
            Portfolio
            <AwesomeSlider
                animation="foldOutAnimation"
                cssModule={[CoreStyles, AnimationStyles]}
            >
                <div data-src="https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/287d8d6a-442d-4453-9737-c5aaaf982746/d8u3p5i-da6b6ec7-c3e2-48bb-9e5f-75b1d6ea2cc0.png?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9.eyJzdWIiOiJ1cm46YXBwOiIsImlzcyI6InVybjphcHA6Iiwib2JqIjpbW3sicGF0aCI6IlwvZlwvMjg3ZDhkNmEtNDQyZC00NDUzLTk3MzctYzVhYWFmOTgyNzQ2XC9kOHUzcDVpLWRhNmI2ZWM3LWMzZTItNDhiYi05ZTVmLTc1YjFkNmVhMmNjMC5wbmcifV1dLCJhdWQiOlsidXJuOnNlcnZpY2U6ZmlsZS5kb3dubG9hZCJdfQ.WQLen4u354JsZ550876yNhh81uqpBMD6KqMrREUweE0" />
            </AwesomeSlider>
        </Fragment>
    )
}

export default Home
